import { Container, Row, Col } from "react-bootstrap";
import inventory from '../api/inventory.json';
console.log(inventory);
const Body = (props) => {
  return (
    <Container>
      <Row className="justify-content-md-center">
        <Col>TAMCN</Col>
        <Col>AAC</Col>
        <Col>SUC</Col>
        <Col>Account Number</Col>
        <Col>Nomenclature</Col>
        <Col>NIIN</Col>
        <Col>Count of Serial Number</Col>
        <Col>Sum of Quantity</Col>
        <Col>Sum of Unit Price</Col>
      </Row>

    </Container>
  );
};

export default Body;
